import React from 'react';
import type { IconType } from 'react-icons';

interface IconProps {
  icon: IconType;
  size?: number | string;
  className?: string;
  color?: string;
}

const Icon: React.FC<IconProps> = ({ icon: IconComponent, size = 20, className = '', ...props }) => {
  return <IconComponent size={size} className={className} {...props} />;
};

export default Icon;
